import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <div>
          <h4>Título </h4>
          <nav className="navbar navbar-dark bg-dark">
            <a href="#" className="text-white">
            Navegación
            </a>
          </nav>
        </div>
        </header>
      </div>
    );
  }
}

export default App;
